---

class: center, middle

&gt;...**to better understand the relationship between income and other socioeconomic factors of disadvantage** (i.e. education, economic status, parenting, single-parenting, driving licence holding, and car availability) **and** three cycling behaviours: **cycling participation, cycling frequency, and cycling distance**.

# Discussion and conclusions

---

### Summary of findings

--

- **People in lower-income household** are **less likely to participate** in utility cycling, particularly **in cycling commuting**.

--

- **No income inequalities** were found **for leisure cycling** participation.

--

- **Lower-income leisure cyclists cycle more often**, but higher-income leisure cyclists further.

--

-  **Bicycle access** might be **an important barrier** to cycle for disadvantaged people.

--

- **More research** on barriers to cycling among disadvantaged populations is needed.

---

### Policy implications

--

- Focus on leisure and non-commuting utility cycling

&lt;!-- Focus on  --&gt;

--

- Implement more measures to increase cycle access and maintenance

]

---

### Strengths and limitations

--

- The focus on **income and other socioeconomic factors** under-researched in the field of 'cycling inequalities'.

--

- Distinction between **recreational and utilitarian cycling**.

--

- Three measurements: **cycling participation, cycling frequency, and cycling distance**. 

--

- The NTS **sample size** for the cycling frequency and cycling distance models was relatively **small**. 

--
&lt;!-- This may result in less reliable estimation and less likely identification of significant relationships.  --&gt;

- **Poor measurement of leisure cycling** in the NTS.

---
